import React from "react";

const Link = (classname, href, children) => {
// console.log(classname);
    const onClick = (event) => {

//         if(event.mataKey || event.ctrlKey){
// return;
//         }
        event.preventDefault();
        window.history.pushState({},'',classname.href);
    }
    return <a onClick={onClick} className={classname.className} href={classname.href} >{classname.children}</a>
}

export default Link;
